runDevelopmentMainDatabase: false
runDevelopmentKeycloakDatabase: false
accessionPrefix: "PP_"
bannerMessage: "This is a staging instance. You should not use it for analysis as it may contain inaccurate test data."
secrets:
  basicauth:
    type: sealedsecret
    clusterWide: true
    encryptedData:
      users: 
  keycloak-admin:
    type: sealedsecret
    clusterWide: "true"
    encryptedData:
      initialAdminPassword: ""
  service-accounts:
    type: sealedsecret
    clusterWide: "true"
    encryptedData:
      backendUserPassword: 
      externalMetadataUpdaterPassword: 
      insdcIngestUserPassword: 
      preprocessingPipelinePassword: 
  database:
    type: sealedsecret
    clusterWide: "true"
    encryptedData:
      host: 
      password: 
      url: 
      username: 
  keycloak-database:
    type: sealedsecret
    clusterWide: "true"
    encryptedData:
      addr: 
      database: 
      password: 
      port: 
      username: 
  ena-submission:
    type: sealedsecret
    clusterWide: "true"
    encryptedData:
      username: 
      password: 
  slack-notifications:
    type: sealedsecret
    clusterWide: "true"
    encryptedData:
      slack-hook: 
      slack-channel-id: 
      slack-token: 
podPriorityClassName: staging
disableEnaSubmission: false
submitToEnaProduction: false
enaDbName: Pathoplexus
enaUniqueSuffix: Pathoplexus
enaIsBroker: True
seqSets:
  enabled: True
  crossRef: null
